# This solution works in my local setup but throws MLE in the LC Judge.
# ========================================================================
import sys

class Solution:
    def lengthAfterTransformations(self, s: str, t: int) -> int:
        def solve(s, t):
            if (s, t) in memo:
                return memo[(s, t)]
            if s == 'ab':
                if t < 25:
                    return 2
                val = solve('z', t-25) + solve('ab', t-25)
            else:
                dist = ord('z') - ord(s)
                if t <= dist:
                    return 1
                val = solve('ab', t - dist - 1)
            memo[(s, t)] = val % MOD
            return memo[(s, t)]
        MOD = 10**9 + 7
        memo = dict()
        res = 0
        for ch in s:
            res = (res + solve(ch, t)) % MOD
        return res % MOD

# Main section
sys.setrecursionlimit(100000)
for s, t in [
               ('abcyy', 2),
               ('azbk', 1),
               ('', 100000),
            ]:
    print(f's, t = {s}, {t}')
    sol = Solution()
    r = sol.lengthAfterTransformations(s, t)
    print(f'r = {r}')
    print('============================')



